INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('MATEMATICA','El enfoque de la asignatura responde a la naturaleza de la Matemática: resolver problemas en los ámbitos científicos, técnicos, sociales y de la vida cotidiana',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('LENGUAJE','Lenguaje y Literatura es el enfoque comunicativo, cuya meta es que los estudiantes aprendan a comunicarse con eficacia y eficiencia en una variedad de situaciones comunicativas',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('QUÍMICA','Se estudian las bases de la teoría atómica, las dispersiones y las soluciones, los enlaces y los compuestos químicos tanto su estructura como su nomenclatura',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('FÍSICA','Se profundiza en el estudio de la cinemática y estática de la partícula, además de estudiar algunas nociones básicas de termodinámica, los principios básicos de los fluidos y de la electricidad',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('BIOLOGÍA','Se estudia la evolución de la vida, la estructura y funciones vitales de la célula, así como el maravilloso mundo de los genes',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('ESTUDIOS SOCIALES','El objetivo principal es la formación de ciudadanos y ciudadanas con visión histórica, ideales democráticos, sentido de pertenencia a una nación y con competencias que les permitan actuar en su entorno y transformarlo.',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('INGLÉS','The English Curriculum for High School focuses on the development of language competencies essential for communicating and properly interacting with the environment.',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('ORIENTACIÓN','Potenciar saberes, habilidades, destrezas y actitudes fundamentales para el desarrollo de la propia identidad a partir de la independencia del pensamiento',true);
INSERT INTO MATERIA (materia, descripcion, enabled_m) VALUES ('INFORMÁTICA','Tiene como finalidad que los estudiantes comprendan la naturaleza de las Tecnologías de Información y Comunicación (TIC)',true);
